document.getElementById('passwordselected').innerHTML = "Please Select A Number Above";
document.getElementById('totalpasswords').innerHTML = "Increase Rolls = Strong Password";

var dicebuttons = document.querySelectorAll(".dicebuttonpanel button");
var x = document.querySelectorAll('.tabContainer .tabPanel');


var copypass = "First Generate";


document.addEventListener('DOMContentLoaded', function () {
    var copyclipboard = document.getElementById('copyclipboard');
    copyclipboard.addEventListener('click', function () {
        const el = document.createElement('textarea');
        el.value = copypass;
        document.body.appendChild(el);
        el.select();
        document.execCommand('copy');
        document.body.removeChild(el);
    });
});



function refresh(buttonnumber) {
    document.body.style.height = "";
    document.querySelector('.diceinfo').style.height = "";
    x[2].style.height = "";

    document.getElementById('passwordselected').innerHTML = "";
    document.getElementById('totalpasswords').innerHTML = "";

    copypass = "";
    dicebuttons.forEach(function (node) {
        node.style.backgroundColor = "";
    });
    dicebuttons[buttonnumber].style.backgroundColor = "rgba(93, 173, 226,0.4)";
    for (var i = -1; i <= buttonnumber; i++) {
        var num = randomnumber();
        if (i == 2) {
            copypass = copypass + wordresult[num];
            var writetext = document.createTextNode(wordresult[num]);
            var brelement = document.createElement('br');
            document.getElementById('passwordselected').appendChild(writetext);
            document.getElementById('passwordselected').appendChild(brelement);
        }
        else {
            copypass = copypass + wordresult[num];
            var writetext = document.createTextNode(wordresult[num]);
            var addspace = document.createTextNode(" ");
            document.getElementById('passwordselected').appendChild(writetext);
            document.getElementById('passwordselected').appendChild(addspace);
        }
    }
    document.getElementById('totalpasswords').innerHTML = passwordcount[buttonnumber];
    if (buttonnumber > 2) {
        document.body.style.height = "285px";
        x[2].style.height = "245px";
        document.querySelector('.diceinfo').style.height = "140px";

    }

}



function randomnumber() {
    var x1 = Math.floor((Math.random() * 6) + 1);
    var x2 = Math.floor((Math.random() * 6) + 1);
    var x3 = Math.floor((Math.random() * 6) + 1);
    var x4 = Math.floor((Math.random() * 6) + 1);
    var x5 = Math.floor((Math.random() * 6) + 1);
    var finalnumber = (x1 * 10000) + (x2 * 1000) + (x3 * 100) + (x4 * 10) + (x5)
    return finalnumber;
}


